import React from "react";
import withRoot from "./withRoot";

import { Query } from "react-apollo";
import { gql } from "apollo-boost";


const Root = () => (
    <Query query={ GET_TRACKS_QUERY } >
    </Query>
);


const GET_TRACKS_QUERY =  gql`
    {
        tracks {
            id
            title
            description
            url 
        }
    }

`


export default withRoot(Root);
